import React, { useState } from 'react';
import logo from './logo.svg';
import './App.css';
import Header from './component/header';
import { Container, Row, Col, DropdownButton, Dropdown } from 'react-bootstrap';

function App() {
  const [showProperty, setShowProperty] = useState('show');

  return (
    <Container fluid='sm'>
      <Header />
      <Row>
        <Col md={4} xs={12}>
          <DropdownButton onMouseOver={() => alert('Hell')} onMouseLeave = {() => setShowProperty('')}
            title="Dropdown right"
            id="dropdown-menu-align-right" showProperty
          >
            <Dropdown.Item eventKey="1">Action</Dropdown.Item>
            <Dropdown.Item eventKey="2">Another action</Dropdown.Item>
            <Dropdown.Item eventKey="3">Something else here</Dropdown.Item>
            <Dropdown.Divider />
            <Dropdown.Item eventKey="4">Separated link</Dropdown.Item>
          </DropdownButton>
        </Col>
        <Col md={{ span: 4, offset: 4 }} xs={12}>{`md={{ span: 4, offset: 4 }}`}</Col>
      </Row>
    </Container>
  );
}

export default App;
